//-------------------------------------------------------------------------------

var Xquery = {};
Xquery.load = function() {

    ace.define('ace/snippets/xquery', ['require', 'exports', 'module' ], function(require, exports, module) {
        
        
        exports.snippetText = "";
        exports.scope = "xquery";
        
        });
        
};

//-------------------------------------------------------------------------------
// Exports
//-------------------------------------------------------------------------------

bugpack.export('acesnippets.Xquery', Xquery);
